# Commands for classifying nocturnal flight calls in western North America.
#
# Thanks to Richard Littauer for the species code commands.


globals:
    annotation_name: Classification
    annotation_scope: Selection

commands:

    ">": [show_next_page]
    "<": [show_previous_page]
    ".": [select_next_clip]
    ",": [select_previous_clip]
    "/": [play_selected_clip]
    "~": [toggle_clip_labels]

